import React from "react";
import ContactCard from "./ContactCard";

const ContactList = (props) => {
  return (
    <div>
      {props.contacts.map((contact) => {
        return (
          <ContactCard
            key={contact.id}
            contact={contact}
            removeContactHandler={props.removeContactHandler}
          />
        );
      })}
    </div>
  );
};

export default ContactList;
